import React from "react";
import NavBar from "./NavBar";
import Header from "./Header";
import { DUMMY_CITY } from "./shared/homapage";
import { Card, CardImg, CardTitle, CardText, CardImgOverlay } from "reactstrap";

const Home = () => {
  return (
    <div>
      <NavBar />
      <Header />
      <div className="container">
        <div className="row">
          {DUMMY_CITY.map((city) => {
            return (
              <Card className="col-12 col-lg-4">
                <CardImg src={city.image} width="100%" alt={city.name} />
                <CardImgOverlay>
                  <CardTitle>{city.name}</CardTitle>
                  <CardText>{city.subText}</CardText>
                </CardImgOverlay>
              </Card>
            );
          })}
        </div>
      </div>
    </div>
  );
};

export default Home;
